import React from 'react';
import { makeStyles, Theme, createStyles } from '@material-ui/core/styles';
import Modal from '@material-ui/core/Modal';
import Backdrop from '@material-ui/core/Backdrop';
import Fade from '@material-ui/core/Fade';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles((theme: Theme) =>
	createStyles({
		modal: {
			display: 'flex',
			alignItems: 'center',
			justifyContent: 'center',
		},
		paper: {
			backgroundColor: theme.palette.background.paper,
			border: '2px solid #000',
			boxShadow: theme.shadows[5],
			padding: theme.spacing(2, 4, 3),
		},
	}),
);

export const AddUser = () => {
	const classes = useStyles();
	const [open, setOpen] = React.useState(false);

	const handleOpen = () => {
		setOpen(true);
	};

	const handleClose = () => {
		setOpen(false);
	};
	const [fileSelected, setFileSelected] = React.useState<File>(); // also tried <string | Blob>

	const handleImageChange = function (e: React.ChangeEvent<HTMLInputElement>) {
		const fileList = e.target.files;

		if (!fileList) return;

		setFileSelected(fileList[0]);
	};

	const uploadFile = function (e: React.MouseEvent<HTMLSpanElement, MouseEvent>) {
		if (fileSelected) {
			const formData = new FormData();
			formData.append('image', fileSelected, fileSelected.name);
		}
	};
	return (
		<div>
			<button type='button' onClick={handleOpen}>
				Thêm Người Dùng Mới
			</button>
			<Modal
				aria-labelledby='transition-modal-title'
				aria-describedby='transition-modal-description'
				className={classes.modal}
				open={open}
				onClose={handleClose}
				closeAfterTransition
				BackdropComponent={Backdrop}
				BackdropProps={{
					timeout: 500,
				}}
			>
				<Fade in={open}>
					<div className={classes.paper}>
						<div className='PacketNew_wrapper'>
							<div className='title'>
								<h3>TẠO MỚI GÓI TIN</h3>
							</div>
							<div className='PacketNew_content'>
								<div className='PacketNew_note'>
									<p>Gói Tin được áp dụng với:</p>
									<p>1. Chuyên mục có phí</p>
									<p>2. Tin đăng về Cần bán/ Cho thuê</p>
									<p>3. Không áp dụng đối với banner quảng cáo, quảng cáo cơ bản</p>
								</div>
								<form className='PacketNew__form'>
									<div className='PacketNew__form--file'>
										<label htmlFor='photo'>
											<input accept='image/*' style={{ display: 'none' }} id='photo' name='photo' type='file' multiple={false} onChange={handleImageChange} />

											<Button component='span' variant='contained' onClick={uploadFile}>
												Choose Picture
											</Button>
										</label>
										<TextField id='standard-name' label='Mã gói' />
										<TextField id='standard-name' label='Tên gói' />
										<TextField id='standard-name' label='Phí' />
										<TextField id='standard-name' label='Chiết khấu' />
										<TextField id='standard-name' label='Số lượng tin' />
										<TextField id='standard-name' label='Thời hạn sử dụng' />
									</div>
									<div className='PacketNew__form--button'>
										<Button variant='outlined'>Hủy bỏ</Button>
										<Button variant='outlined' type='submit' value='Submit'>
											Tạo mới
										</Button>
									</div>
								</form>
							</div>
						</div>
					</div>
				</Fade>
			</Modal>
		</div>
	);
};
